content.css:
.row {
  width: 100%;
  margin: 0 auto;
}
.relative {
  position: relative;
  height: 21.5px;
  width: 17700px;
  background-color: "white";
}
.monthitem {
  display: inline-block;
  width: 275px;
  height: 21.5px;
  text-align: center;
  border: gray;
  background-color: #E8562A;
  color: #fff;
  cursor: pointer;
  font-weight: bold;
}
.parent {
  position: relative;
}
.container {
  display: flex;
  flex-wrap: wrap;
  width: 100%;
}
/* Loading Circle */
.loading-circle {
  position: absolute;
  top: 85%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 40px;
  height: 40px;
  border-radius: 50%;
  border: 4px solid #f3f3f3;
  border-top: 4px solid #ff0808;
  animation: spin 1s linear infinite;
}
@keyframes spin {
  0% {
    transform: translate(-50%, -50%) rotate(0deg);
  }
  100% {
    transform: translate(-50%, -50%) rotate(360deg);
  }
}


